description:
Across Saskatchewan the lives of an unsuspecting group of people are about to change in ways they could never imagine. When it&amp;#039;s all over, thirteen lost and damaged souls will have crossed paths in mysterious and unexpected ways on a desperate journey to a shared spiritual destination.

This outstanding drama was missed by all cappers when if first aired in fall 2007.  It features an all star Canadian cast.  From some of the same creative team that gave you Mocassin Flats and Rabbit Fall.

I capped it on a rebroadcast.  Hopefully enough downloads will help insure a second season.
